			data.address = dataJsonp.SADDR;
			//$scope.itentify = dataJsonp.STYPE; //户口性质
			if(dataJsonp.STYPE.substring(0, 1) == "非") {
				$scope.itentify = "非农业户口";
			} else {
				$scope.itentify = "农业户口";
			}

			$scope.numberFaimly = dataJsonp.EXTENDDATA.CZRK;
